import styles from "../assets/NavBar.module.css";
import { Link } from "react-router-dom";

function NavBar(open) {
  return open ? (
    <li className={styles.navBarContainer}>
        <Link to="/">
          <p>Home</p>
        </Link>
        <Link to="/shows">
          <p>Shows</p>
        </Link>
        <Link to="/contact">
          <p>Contact</p>
        </Link>
        <Link to="/about">
          <p>About</p>
        </Link>
      </li>
  ):(
    <div></div>
  )
}

export default NavBar;
